import React from 'react'

function App() {
  const Header =(props)=>{
    return(
      <header>
        <h1>
          <a href='/'>{props.title}</a>
        </h1>
      </header>
    )
  }
  const Nav =(props)=> {
    const lis = [];
    props.topics.map((item) => lis.push(<li key={item.id}><a href={`/read/${item.id}`}>{item.title}</a></li>));
    return(
      <nav>
      <ol>
        {lis}
      </ol>
    </nav>
    )
  }
  const Article =(props)=> {
    return(
      <article>
        <h2>{props.title}</h2>
        {props.body}
      </article>
    )
  }
  const topics = [
    {id:1, title:"html", body:"html is ..."},
    {id:2, title:"css", body:"css is ..."},
    {id:3, title:"javascript", body:"javascript is ..."},
  ]
  return (
    <div>
      <Header title="WEB" onch></Header>
      <Nav topics={topics}></Nav>
      <Article title="Welcome" body="Hello, WEB"></Article>
    </div>
  )
}

export default App
